import React from 'react';

const e = React.createElement;

class RadioButton extends React.Component{

    render(){
        return e('div',{},
        e('label',{for:'test'},
            e('input',{type:'radio'}),
            e('span',{},this.props.label)
        )
        )
    }
}

export default RadioButton;
